script: |
  super -f text -I q6689.spq | sort > q6689.out

inputs:
  - name: q6689.spq
    data: |
      SELECT DISTINCT col0 * col1 - col2 AS col1 FROM tab1 (FORMAT parquet) WHERE NULL NOT BETWEEN + col0 + - col0 / col1 AND ( col0 + - col2 + col0 );
  - name: tab1

outputs:
  - name: q6689.out
    data: |
